INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("春咲 ひより", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 1, 1.4, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 1, 2, 0, 1001, "お！\nあそこに困ってそうな人発見！", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("草野 優衣", "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 1, 1.4, "みんなみたいに\nわたしも強くならなきゃ", 0, 0, 1, 2, 0, 1002, "大切な人を\n守れるようになりたい…って", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("士条 怜", "少しは磨かれると思いますよ。", 0, 1, 1.4, "フェンシングを始めてみては？", 0, 0, 1, 2, 0, 1003, "キミに必要な集中力と感性が", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("穂高 みそぎ", "みそぎはねぇ、\nかくれんぼやりたい！", 0, 1, 1.5, "ねぇ、にいちゃん！", 0, 0, 1, 2, 0, 1004, "今日はなにして遊ぶ？", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("風宮 あかり", "私といっしょに…\nいかない？", 0, 1, 1.4, "風宮あかりです", 0, 0, 1, 2, 0, 1006, "ねぇ…", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("出雲 宮子", "食べ物の恨みは怖いのー", 0, 1, 1.5, "出雲宮子なのー", 0, 0, 1, 2, 0, 1007, "プリンたべたいのー", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("虹村 雪", "いいよ。\n見られることは運命さ…", 0, 1, 1.4, "ボクは虹村雪。", 0, 0, 1, 2, 0, 1008, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("柊杏奈", "人呼んで「疾風の冥姫」!!", 0, 1, 1.4, "フッ…聞いて後悔するがいい！", 0, 0, 1, 2, 0, 1009, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("姫宮 真歩", "ほんまおおきにやわ～♪", 0, 1, 1.5, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 1, 2, 0, 1010, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("衣之咲 璃乃", "ここで会ったが\n100年目～！", 0, 1, 1.4, "衣之咲璃乃です！", 0, 0, 1, 2, 0, 1011, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("柏崎 初音", "…って、お願い！\n誰にも言わないでおいて～！", 0, 1, 1.4, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, 1, 2, 0, 1012, "ち、超能力って…\n何のことかな～？", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("美波 鈴奈", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 1, 1.4, "ちょす！\n美波鈴奈だよ～♪", 0, 0, 1, 2, 0, 1016, "一応カリスマ読モJKやってまっす！", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("喜屋武 香織", "でも、沖縄もとってもいいとこさー", 0, 1, 1.4, "はいたーい。\n喜屋武香織さー。", 0, 0, 1, 2, 0, 1017, "東京は遊園地みたいなところさー", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("支倉 伊緒", "イオちゃんって呼んでね。", 0, 1, 1.4, "支倉伊緒です。", 0, 0, 1, 2, 0, 1018, "先生って呼ばれるのは\nくすぐったいから", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("茜 ミミ", "ミミをおいてかないでぇ～", 0, 1, 1.5, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, 1, 2, 0, 1020, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("栗林 くるみ", "ふぇぇぇぇぇん……", 0, 1, 1.5, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 1, 2, 0, 1021, "あの……\nふぇ……", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("風宮 より", "なんてありがとうございます！", 0, 1, 1.4, "風宮よりです。\nあああああ！", 0, 0, 1, 2, 0, 1022, "こんな私に貴重な時間を\n割いていただき、", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("北条 綾音", "私こっち行きたいー\nね、早く早くー", 0, 1, 1.5, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 1, 2, 0, 1023, "おにいちゃんどこいくの？\nえ？", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("天野 すずめ", "これて何か違う…\nあああすみません！", 0, 1, 1.4, "わっ…わっ…私、\n天野すずめといいます！", 0, 0, 1, 2, 0, 1025, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("倉石 恵理子", "離しませんわ………\n絶対に…!!", 0, 1, 1.4, "……クスクス…私は\n…倉石恵理子……", 0, 0, 1, 2, 0, 1027, "あなたは…運命の……\n伴侶……", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("佐々木 咲恋", "…そうでしょ？？", 0, 1, 1.4, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 1, 2, 0, 1028, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("桜井 望", "あはは、\n私もまだまだだなぁ～", 0, 1, 1.4, "桜井望だよ！\nよろしくねっ", 0, 0, 1, 2, 0, 1029, "ぇっと…\nキミ、私のこと知らないの?!", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("ニノン・ジュベール", "ショーグン、\nワタシと一緒に天下統一デース！", 0, 1, 1.4, "デケデケデンっ！", 0, 0, 1, 2, 0, 1030, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("上喜 しのぶ", "おかしいですね……", 0, 1, 1.4, "上喜しのぶです。\n手元のドクロが父です。", 0, 0, 1, 2, 0, 1031, "でもって私の隣にいるのが……\nえ、見えない？", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("野戸まひる", "そう、\nオラのボケに突っ込める相方が…！", 0, 1, 1.5, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, 1, 2, 0, 1033, "けんども\nそれには足りないモンが…", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("綾瀬 ゆかり", "ちょ\nちょっと一杯飲んできます…！", 0, 1, 1.4, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, 1, 2, 0, 1034, "ちょっと緊張しちゃって…", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("氷川 鏡華", "これ以上お話しすることは…\nないです！", 0, 1, 1.5, "氷川鏡華…です", 0, 0, 1, 2, 0, 1036, "知らない人とは話しちゃいけないので", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("柏崎 栞", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 1, 1.4, "柏崎…栞です。", 0, 0, 1, 2, 0, 1038, "……あ、アラーム。", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("双葉 碧", "野に咲く花が、\n唯一の話相手です。", 0, 1, 1.4, "ふ、双葉碧です。", 0, 0, 1, 2, 0, 1040, "私、一人も友達がいなくて……", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("三角 千歌", "そう思っています。", 0, 1, 1.4, "三角千歌です。", 0, 0, 1, 2, 0, 1042, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("安芸 真琴", "う、疑ってすまなかったな…", 0, 1, 1.4, "安芸真琴だ。", 0, 0, 1, 2, 0, 1043, "あぁ？\nお前のそいつの仲間か？", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("イリヤ・オーンスタイン", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 1, 1.4, "わらわこそは夜を総べる者！", 0, 0, 1, 2, 0, 1044, "生けとし生ける全ての者よ！", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("遠見 空花", "ｌク、クウカに何かご用ですか!?", 0, 1, 1.4, "そこで騎士は妖精を乱暴に……", 0, 0, 1, 2, 0, 1045, "ぐふふふふ……はっ！", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("宮坂たまき", "う～ん…\n猫ってホントに最高にゃ～♪", 0, 1, 1.4, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, 1, 2, 0, 1046, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("大神 美冬", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 1, 1.4, "大神美冬よ！", 0, 0, 1, 2, 0, 1048, "それでは早速クエストに…", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("星野静流", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 1, 1.4, "星野静流だよ！", 0, 0, 1, 2, 0, 1049, "クエストもバトルも\n掃除も洗濯も", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("玉泉美咲", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 1, 1.5, "アタシは玉泉美咲。", 0, 0, 1, 2, 0, 1050, "見ての通りの\nセクシー美少女で", 0, 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("リマ", "？？？？", 0, 1, 1.4, "？？？", 0, 0, 1, 2, 0, 1052, "？？？？", 0, 1);
